const normalizedEvents = allEvents.map(
  ({ latitude, longitude, name, location, image, startDate, endDate, conferenceUrl }) => {
    const latlon: [number, number] | undefined =
      latitude === '' && longitude === ''
        ? undefined
        : [Number(latitude), Number(longitude)];

    const normalizedEvent = {
      conferenceUrl,
      name: name.trim(),
      location: location.trim(),
      image: image.trim(),
      startDate: startDate.trim(),
      endDate: endDate.trim(),
      ...(latlon && { latlon })
    };

    return normalizedEvent;
  }
);
export const filteredEvents: EventItemType[] = normalizedEvents.filter(
  ({ name, location, image, startDate, endDate }) => {
    const isInPast = endDate && getIsInPast(new Date(endDate));
    const isToday = endDate && getIsToday(new Date(endDate));
    if (
      name !== '' &&
      location !== '' &&
      image != '' &&
      startDate != '' &&
      endDate != '' &&
      !isInPast &&
      !isToday
    ) {
      return true;
    }
  }
);

export const filteredEventsWithCoordinates: EventItemType[] = filteredEvents.filter(
  ({ latlon }) => !!latlon
);
